import React from "react";

const MyData = () => {
  return (
    <>
      <h1>My Data</h1>
      <div className="site-layout-content">
        {myDataResponse !== undefined ? (
          <table>
            <tbody>
              {myDataResponse.map((subDivs, i) => (
                <>
                  {subDivs.map((value, j) => (
                    <tr key={i}>
                      {value.map((innervalue, j) => (
                        <td key={j}>{innervalue}</td>
                      ))}
                    </tr>
                  ))}
                </>
              ))}
            </tbody>
          </table>
        ) : null}{" "}
      </div>
    </>
  );
};
export default MyData;
